export class CardModel {
  constructor(rank, suit, src) {
    this.rank = rank;
    this.suit = suit;
    this.src = src;
  }

  get numberedRank() {
    let numberedRank = +this.rank;

    if (numberedRank) {
      return numberedRank;
    }

    if (this.rank == "J") {
      return 11;
    }

    if (this.rank == "Q") {
      return 12;
    }

    if (this.rank == "K") {
      return 13;
    }

    if (this.rank == "A") {
      return 14;
    }

    return -1;
  }

  get numberedSuit() {
    if (this.suit == "hearts") {
      return 4;
    }

    if (this.suit == "spades") {
      return 3;
    }

    if (this.suit == "diamonds") {
      return 2;
    }

    return 1;
  }

}
